<script>
import { mapGetters } from 'vuex'
import InfectionClassesService from '@/services/InfectionClassesService'
import PlayerClassesService from '@/services/PlayerClassesService'
import ResearchCenterClassesService from '@/services/ResearchCenterClassesService'

export default {
  name: 'WorldMap',
  computed: {
    ...mapGetters({
      game: 'activeGame'
    })
  },
  methods: {
    handleCellClick (cityStaticid) {
      this.$store.dispatch('showActionMenu', {
        game: this.game,
        cityStaticid: cityStaticid,
        pageX: event.pageX,
        pageY: event.pageY,
        windowHeight: window.innerHeight,
        windowWidth: window.innerWidth
      })
    },
    handleInfectionClick (cityStaticid, position) {
      console.log(`handling infection for ${cityStaticid} at position ${position}.`)
    },
    handlePlayerClick (cityStaticid, position) {
      this.$store.dispatch('showPlayerActionMenu', {
        game: this.game,
        cityStaticid: cityStaticid,
        position: position,
        pageX: event.pageX,
        pageY: event.pageY,
        windowHeight: window.innerHeight,
        windowWidth: window.innerWidth
      })
    },
    infectionClasses (cityStaticid, position) {
      return InfectionClassesService.for(cityStaticid, position, this.game)
    },
    playerClasses (cityStaticid, position) {
      return PlayerClassesService.for(cityStaticid, position, this.game)
    },
    researchCenterClasses (cityStaticid) {
      return ResearchCenterClassesService.for(cityStaticid, this.game)
    },
    innerInfectionRateCircleCssClasses (position) {
      if (this.game) {
        return this.game.innerInfectionRateCircleCssClasses(position)
      } else {
        return ''
      }
    },
    outerInfectionRateCircleCssClasses (position) {
      return 'outer-circle-infection-marker'
    },
    outbreakCssClass (position) {
      if (this.game.outbreaksNr === position) {
        return 'outbreaks-color-active'
      } else {
        return `outbreaks-color-${position}`
      }
    }
  }
}
</script>
